def parse_grammar(grammar_string):
    """
    Parses a Chomsky normal form grammar string and returns a dictionary
    of productions.
    """
    grammar = {}
    tokens = grammar_string.split()

    for token in tokens:
        if token in grammar:
            grammar[token] = grammar[token]
        else:
            grammar[token] = ""

    return grammar

